import React, { useState } from 'react';

import Input from '../../UI/Input/Input';
import classes from './NewService.module.css';

const NewService = (props) => {
  const [serviceName, setServiceName] = useState();
  const [nameIsValid, setNameIsValid] = useState();
  const [serviceDate, setServiceDate] = useState();
  const [dateIsValid, setDateIsValid] = useState();
  const [serviceMileage, setServiceMileage] = useState();
  const [mileageIsValid, setMileageIsValid] = useState();
  const [serviceInfo, setServiceInfo] = useState();

  const onSubmitForm = () => {};

  const serviceChangeHandler = () => {};

  const validateServiceHandler = () => {};

  const dateChangeHandler = () => {};

  const validateDateHandler = () => {};

  const mileageChangeHandler = () => {};

  const validateMileageHandler = () => {};

  const infoChangeHandler = () => {};

  const validateInfoHandler = () => {};

  return (
    <div className={classes['new-service']}>
      <form onSubmit={onSubmitForm} className={classes['service-form']}>
        <Input
          id="service"
          label="Service"
          type="text"
          isValid={nameIsValid}
          value={serviceName}
          onChange={serviceChangeHandler}
          onBlur={validateServiceHandler}
          className={classes['service-name']}
        />
        <div className={classes['service-date-box']}>
        <Input
          id="date"
          label="Date"
          type="date"
          isValid={dateIsValid}
          value={serviceDate}
          onChange={dateChangeHandler}
          onBlur={validateDateHandler}
          className={classes['service-date']}
        />
        <Input
          id="mileage"
          label="Mileage"
          type="number"
          isValid={mileageIsValid}
          value={serviceMileage}
          onChange={mileageChangeHandler}
          onBlur={validateMileageHandler}
          className={classes['service-mileage']}
        />
        </div>
        <Input
          id="info"
          label="Info"
          type="text"
          value={serviceInfo}
          onChange={infoChangeHandler}
          onBlur={validateInfoHandler}
          className={classes['service-info']}
        />
      </form>
    </div>
  );
};

export default NewService;
